    <div>
    <p class=MsoNormal><b><span style='font-size:24.0pt;line-height:105%;
    font-family:"Agency FB",sans-serif'>Now or <span class=GramE>Never</span><br>
    by Kendrick Lamar and Mary J. Blige<o:p></o:p></span></b></p>
    <p class=MsoNormal><o:p>&nbsp;</o:p></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Bookman Old Style",serif'>Lyrics<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Bookman Old Style",serif'>We on?<br>
    <span class=SpellE>A'ight</span><br>
    One, two, three, go!<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Bookman Old Style",serif'>Waking up in a dream<br>
    Sleepwalking on another big stage<br>
    You never heard peace 'til you hear people scream<br>
    Your name in unison, I'm so far away<br>
    From the place I used to be, struggling usually<br>
    Look at the newer me, fate pursuing me<br>
    I can feel the energy in the air<br>
    It feel like I'm supposed to be here<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Bookman Old Style",serif'>Everywhere I go, I'm getting so much
    love<br>
    Fans, the stars, everyone<br>
    Sayin' how they can't wait for the LP<br>
    And I'm <span class=SpellE>gonna</span> blow, they believe in me<br>
    Feel so good in what you do<br>
    Helps somebody else get through<br>
    That's why I do the best I can<br>
    Because I know how blessed I am<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Bookman Old Style",serif'>I'm so high, I can touch the sky<br>
    I know it's my time, and it's now or never<br>
    Shine so bright, I light the night<br>
    And it feels so right, <span class=SpellE>ain't</span> nothing better<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Bookman Old Style",serif'>A fool if I take it all for granted<br>
    A smart man if I keep my feet planted<br>
    To the earth, <span class=SpellE>'cause</span> the people that hurt can
    understand it<br>
    You <span class=SpellE>speakin</span>' outlandish, <span class=SpellE>I'ma</span>
    show you how to make it all work<br>
    Another planet, it's a <span class=GramE>short term</span> goal for me<br>
    A record sold for me, it's just more of me in your ear<br>
    For you to hear Kendrick persevere, defenses I feel relentless<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Bookman Old Style",serif'>Ambition with a clear vision<br>
    Takin' off, I <span class=SpellE>ain't</span> takin' off these Pistons<br>
    I'm takin' off on the inner me, <span class=GramE>you're</span> distance<br>
    Came across me, how much it'll cost me<br>
    To get you out my business<br>
    I said a planet is a short term goal, no sky is the limit<br>
    I'm past that, now pass that award<br>
    Not one but four times two plus yours<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Bookman Old Style",serif'>I see myself performing there
    (K.dot)<br>
    Sold out shows where the room is packed<br>
    Sitting at the Grammy's winning five awards<br>
    See myself on big billboards<br>
    Traveling around the world with endorsement deals<br>
    Can't imagine how it feels<br>
    That's why I'm smiling <span class=SpellE>everyday</span><br>
    Because my dream <span class=SpellE>ain't</span> far away<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Bookman Old Style",serif'>I'm so high, I can touch the sky<br>
    I know it's my time, and it's now or never<br>
    Shine so bright, I light the night<br>
    And it feels so right, <span class=SpellE>ain't</span> nothing better<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Bookman Old Style",serif'>You looking at me, and you tell me
    I'm blessed<br>
    Calculated my steps, my heart, my breath<br>
    Breathe in lungs of a victory and vividly<br>
    You see me when at my best, my worst<br>
    This verse dedicated to the days that I slept<br>
    With a curse research my paid dues, I'm reimbursed<br>
    I burst in the crowd with a voice and a crown<br>
    I'm a King on the prowl and I see mama smile<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    font-family:"Bookman Old Style",serif'>And I vow on the tape that I'll
    never break<br>
    You can break bread with me now<br>
    </span><span style='font-size:16.0pt;line-height:105%;font-family:"Bookman Old Style",serif'>We
    can all take a bow on the edge of the pedestal<br>
    Then scream out loud that we made it off the avenue<br>
    And walked that mile<br>
    In the darkness I often sit back and get lost in the rap that I wrote<br>
    When you told me that it spoke to your soul<br>
    I was talking to you, I was walking it through every ghetto<br>
    Tell success &quot;Hello&quot;<br>
    We here<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:16.0pt;line-height:105%;
    font-family:"Agency FB",sans-serif'>And I'm so happy I cry <span
    class=SpellE>'cause</span> I can't believe<br>
    All the things I ever wanted are finally happening for me<br>
    And it's so surreal that I almost feel<br>
    That any minute I can wake up from this fantasy<br>
    When you pray so hard, and you've come so far<br>
    And you know that it's the time for you to lift your bar<br>
    And I'm <span class=SpellE>gonna</span> do it, watch me<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:16.0pt;line-height:105%;
    font-family:"Agency FB",sans-serif'>I'm so high, I can touch the sky<br>
    I know it's my time, and it's now or never<br>
    Shine so bright, I light the night<br>
    And it feels so right, <span class=SpellE>ain't</span> nothing better<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:16.0pt;line-height:105%;
    font-family:"Agency FB",sans-serif'>I'm so high, I can touch the sky<br>
    I know it's my time, and it's now or never<br>
    Shine so bright, I light the night<br>
    And it feels so right, <span class=SpellE>ain't</span> nothing better<o:p></o:p></span></p>
    <p class=MsoNormal><o:p>&nbsp;</o:p></p>
